object.script:
function onTick() dist = property.getNumber("Distance to Monitor (Blocks)") monitor = property.getNumber("Monitor Size (Blocks)") arm = input.getBool(3) lX = input.getNumber(9) lY = input.getNumber(10) msl = input.getNumber(11) gun = input.getNumber(12) end
function onDraw() w = screen.getWidth() h = screen.getHeight()
size=(h/monitor)*dist lXO = math.floor(math.tan(lX)*size) lYO = math.floor(math.tan(-lY)*size*2.5)
if arm then screen.setColor(0,255,0) screen.drawText(7+lXO, h-20+lYO, "Gun") screen.drawText(7+lXO, h-12+lYO, math.floor(gun)) screen.drawText(w-20+lXO, h-12+lYO, string.format("A%0.0fM", msl))
gunX=w/2-1+lXO gunY=h/2-9+lYO screen.drawLine(gunX-2, gunY, gunX+3, gunY) screen.drawLine(gunX, gunY-2, gunX, gunY+3) end end
